import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-gray-900 p-4 text-white flex justify-between">
      <h1 className="text-xl font-bold">üîê AI IDS/IPS</h1>
      <div>
        <Link to="/" className="mx-2">Home</Link>
        <Link to="/logs" className="mx-2">Logs</Link>
        <Link to="/attacks" className="mx-2">Attacks</Link>
        <Link to="/detect" className="mx-2">Detect Attack</Link>
      </div>
    </nav>
  );
};

export default Navbar;
